// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "./ERC721A.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/utils/cryptography/MerkleProof.sol";
import "@openzeppelin/contracts/utils/math/SafeMath.sol";

contract ScareBears is ERC721A, Ownable{
    // Name “Scare Bears”
    // Ticker “SCB”
    // Total supply 8888
    // Max mint per addresss 3
    // Public sale price .15E
    // Whitelist sale price .14E
    // Whitelist sale duration 3000 minters (up to 3 mints per user)
    using Strings for uint256;
    using SafeMath for uint256;

    uint256 public maxSupply = 8888;
    uint256 public constant MAX_WHITELIST_SUPPLY = 3000;
    uint256 public constant MAX_MINT = 3;
    uint256 public constant PUBLIC_SALE_PRICE = .15 ether;
    uint256 public constant WHITELIST_SALE_PRICE = .14 ether;

    string private baseTokenUri;
    string public placeholderTokenUri;

    //deploy smart contract, pause immediatly, unpause for WL, pause when WL done, toggle publicSale, unpause for public sale, 
    //2 days later toggle reveal
    bool public isRevealed;
    bool public publicSale;
    bool public pause;

    address public artistAddress;

    bytes32 private merkleRoot;

    mapping(address => uint256) public totalMint;

    constructor() ERC721A("Scare Bears", "SCB"){

    }

    modifier callerIsUser() {
        require(tx.origin == msg.sender, "Scare Bears :: Cannot be called by a contract");
        _;
    }

    function mint(uint256 _quantity) external payable callerIsUser{
        require(!pause, "Scare Bears :: Minting is on Pause");
        require(publicSale, "Scare Bears :: Public sale is not yet activated, whitelist sale is still on going.");
        require((totalSupply() + _quantity) <= maxSupply, "Scare Bears :: Cannot mint beyond max supply");
        require((totalMint[msg.sender] +_quantity) <= MAX_MINT, "Scare Bears :: Already minted 3 times!");
        require(msg.value >= (PUBLIC_SALE_PRICE * _quantity), "Scare Bears :: Payment is below the price");

        totalMint[msg.sender] += _quantity;
        _safeMint(msg.sender, _quantity);
    }

    function whitelistMint(bytes32[] memory _merkleProof, uint256 _quantity) external payable callerIsUser{
        bytes32 sender = keccak256(abi.encodePacked(msg.sender));
        require(!pause, "Scare Bears :: Minting is on Pause");
        require(!publicSale, "Scare Bears :: Whitelist sale is over");
        require((totalSupply() + _quantity) <= maxSupply, "Scare Bears :: Cannot mint beyond max supply");
        require((totalMint[msg.sender] + _quantity)  <= MAX_MINT, "Scare Bears :: Cannot mint beyond whitelist max mint!");
        require(msg.value >= (WHITELIST_SALE_PRICE * _quantity), "Scare Bears :: Payment is below the price");
        require(MerkleProof.verify(_merkleProof, merkleRoot, sender), "Scare Bears :: You are not whitelisted");

        totalMint[msg.sender] += _quantity;
        _safeMint(msg.sender, _quantity);
    }

    function _baseURI() internal view virtual override returns (string memory) {
        return baseTokenUri;
    }

    function tokenURI(uint256 tokenId) public view virtual override returns (string memory) {
        require(_exists(tokenId), "ERC721Metadata: URI query for nonexistent token");

        if(!isRevealed){
            return placeholderTokenUri;
        }
        //string memory baseURI = _baseURI();
        return bytes(baseTokenUri).length > 0 ? string(abi.encodePacked(baseTokenUri, tokenId.toString())) : "";
    }

    /// @dev walletOf() function shouldn't be called on-chain due to gas consumption
    function walletOf() external view returns(uint256[] memory){
        address _owner = msg.sender;
        uint256 numberOfOwnedNFT = balanceOf(_owner);
        uint256[] memory ownerIds = new uint256[](numberOfOwnedNFT);

        for(uint256 index = 0; index < numberOfOwnedNFT; index++){
            ownerIds[index] = tokenOfOwnerByIndex(_owner, index);
        }

        return ownerIds;
    }

    function setTokenUri(string memory _baseTokenUri) external onlyOwner{
        baseTokenUri = _baseTokenUri;
    }
    //setter function
    function setMerkleRoot(bytes32 _merkleRoot) external onlyOwner{
        merkleRoot = _merkleRoot;
    }

    //getter function 
    function getMerkleRoot() external view returns(bytes32){
        return merkleRoot;
    }

    function setMaxSupply(uint256 _maxSupply) external onlyOwner{
        maxSupply = _maxSupply;
    }

    function togglePause() external onlyOwner{
        pause = !pause;
    }

    function toggleReveal() external onlyOwner{
        isRevealed = !isRevealed;
    }

    function togglePublicSale() external onlyOwner{
        publicSale = !publicSale; 
    }

    function withdraw() external onlyOwner{
        uint256 balance = address(this).balance;
        payable(artistAddress).transfer(balance * 20 / 100);
        payable(msg.sender).transfer(address(this).balance);
    }
}
